    "data": "\\Row(data=u'\\\"Row(content=u\\\\'Australian Dollar Remains Steady New Zealand Dollar Stronger  Janet Yellen\\\\\\\\x92s speech remains in focus \\\\\\\\r\\\\\\\\nThe Aussie remained steady against the dollar this Tuesday as the kiwi grew stronger while market players processed last session\\\\\\\\x92s US economic reports and focused on Fed\\\\\\\\x92s Chair Janet Yellen\\\\\\\\x92s speech due later Tuesday. \\\\\\\\r\\\\\\\\nAUD/USD was slightly changed at 0.7545 NZD/USD surged 0.28% to trade at 0.6743. \\\\\\\\r\\\\\\\\nThe US Commerce Department report on Monday showed that personal spending moved up 0.1% in February in accordance with economists\\\\\\\\x92 expectations. \\\\\\\\r\\\\\\\\nThere has been a 0.2% rise in personal income above forecasts for a 0.1% gain. \\\\\\\\r\\\\\\\\nThe Federal Reserve\\\\\\\\x92s preferred inflation measure declined 0.1% the previous month because of lower energy costs. \\\\\\\\r\\\\\\\\nThe PCE index moved up 1% on an annual basis lower than its 1.2% increase in January. \\\\\\\\r\\\\\\\\nIn spite of the tightening labor market the Fed may increase rates only gradually in 2016 data suggested. \\\\\\\\r\\\\\\\\nDuring early trading USD/JPY added 0.17% to 113.64. Japanese household spending for February added 1.2 percent while annually it fell 1.5 percent. Unemployment was up 3.3% and retail sales added 0.5% for February and 1.7% year on year. \\\\\\\\r\\\\\\\\nDuring early Asian trading the euro was steady at 1.1194 dollars after adding about 0.3 percent against the greenback following six days of losses. \\\\\\\\r\\\\\\\\nInvestors are waiting for Janet Yellen\\\\\\\\x92s speech on Tuesday for new indications regarding interest rates. \\\\\\\\r\\\\\\\\nThe US dollar index which measures the greenback\\\\\\\\x92s strength versus a basket of six other major currencies was up 0.10% at 96.09 not far from Monday\\\\\\\\x92s one-week high of 96.42.\\\\')\\\"')\\",
