    "currpair": "USDCAD",
    "data": "\\Row(data=u'\\\"Row(content=u\\\\'LOONIE DIMS AGAINST US DOLLAR AHEAD OF BOC MEETING\\\\\\\\r\\\\\\\\nToday the Department of the Treasury released the Federal Budget Balance with a $108.0 billion dollar deficit less than the $192.6 billion number published in February. The data measures the difference in value between the federal government\\\\\\\\x92s income and spending during the previous month. \\\\\\\\r\\\\\\\\nCore US retail sales data will be released later today. It measures the change in the total value of sales at the retail level excluding automobiles. It is expected to witness a 0.4% rise in March. The forecast is for a higher number compared with 0.1% decline in February. \\\\\\\\r\\\\\\\\nThe Producer Price Index (PPI) data is also due to be released later today. It is a leading indicator of consumer inflation and is forecast to rise 0.3% after dropping 0.2% the month before. The index measures the change in the price of finished goods and services sold by producers. \\\\\\\\r\\\\\\\\nFurther data on consumer spending in the retail sector in March is also on schedule. It is expected to witness the first monthly increase in 2016. Investors expect retail sales to rise 0.1% after dropping 0.1% in February. However even if the forecast holds up the yearly trend will still be hovering near the most sluggish growth rate since last November. \\\\\\\\r\\\\\\\\nThe Core CPI reading which is also a part of the data to be released measures the change in the price of finished goods and services sold by producers excluding food and energy. It is predicted to inch up by 0.1% for March. \\\\\\\\r\\\\\\\\nThe most awaited event of the day is Bank of Canada\\\\\\\\x92s interest rate decision and its forecast about the economy which follows the strong bull market witnessed in the Canadian dollar. The market expects no change in the interest rates. However the meeting will be tracked closely for every attempt to talk the currency down. Bank of Canada Governor Stephen Poloz is expected to talk about the increasing economic risks in the current environment.  \\\\\\\\r\\\\\\\\nFig: USDCAD H4 Technical Chart \\\\\\\\r\\\\\\\\nUSDCAD extended the recovery from the support level at 1.27412 to as high as 1.28028. RSI is now hovering at around level 32 signaling that the price is about to escape from the oversold territory. Though the short-term moving average is putting pressure overhead the pair is anticipated to gain further and hit the resistance level at 1.28483.  Trade suggestion \\\\\\\\r\\\\\\\\nBuy Stop at 1.28122 Stop loss at 1.27817 Take profit at 1.28529.\\\\')\\\"')\\",
